import react,{Component} from 'react'

const TableBody = (props) => {
    const name = props.namesarray.map((row,index)=>{
        return(
            <tr key="{index}">
                <td>{row}</td>
            </tr>
        )
    })
    return (
        <tbody>
            <tr>
                <td>Charlie</td>
                <td>Janitor</td>
            </tr>
            <tr>
                <td>Mac</td>
                <td>Bouncer</td>
            </tr>
            <tr>
                <td>Dee</td>
                <td>Aspiring actress</td>
            </tr>
            <tr>
                <td>Riddhi</td>
                <td>Developer</td>
            </tr> 
        </tbody>
    )
}
const TableHead = () => {
    return (
    <thead>
        <tr>
          <th>Name</th>
          <th>Job</th>
        </tr>
      </thead>
      )
}
class Table extends Component{
    render(){
        const {names} = this.props
        return(
            <table>
        <TableHead />
        <TableBody namesarray = {names}/>
      </table>
        )
    }
}

export default Table
